<!-- Uppgift: En navbar-komponent
Instruktioner
Skapa en komponent med namnet “navbar”, och låt denna komponent rendera ett nav-element, som i sin tur innehåller minst tre länkar (a-element).

Man ska alltså kunna skriva <navbar></navbar> för att producera ett nav-element innehållandes tre länkar. Länkarna behöver inte leda någonstans.

Din lösning -->

<!DOCTYPE html>
<html lang="sv">
  <head>
    <meta charset="utf-8">
    <title>En navbar-komponent</title>
    <meta content="initial-scale=1, width=device-width" name="viewport">
  </head>
  <body>
    <div id="app">
      <navbar></navbar>
    </div>
    <script src="https://unpkg.com/vue@next"></script>
    <script src="index.js"></script>
  </body>
</html>
